# Leninskoye, Baltiysky Selsoviet, Iglinsky District, Republic of Bashkortostan

}}
Leninskoye () is a rural locality (a village) in Baltiysky Selsoviet, Iglinsky District, Bashkortostan, Russia. The population was 268 as of 2010.
Geography
It is located 11&nbsp;km from Iglino and 2&nbsp;km from Baltika.
